import React, { useState } from 'react';
import UsersList from '../../components/UsersList';

const AdminDashboard = () => {
  const [systemStats, setSystemStats] = useState({
    totalUsers: 243,
    activeToday: 46,
    newThisWeek: 12
  });

  const recentActivities = [
    { id: 1, message: 'User john@example.com logged in', timestamp: '2 min ago' },
    { id: 2, message: 'New user registered: jane@example.com', timestamp: '15 min ago' },
    { id: 3, message: 'Password reset for bob@example.com', timestamp: '1 hour ago' },
    { id: 4, message: 'Admin user modified: smith@example.com', timestamp: '3 hours ago' },
    { id: 5, message: 'System backup completed', timestamp: '5 hours ago' }
  ];

  const upcomingTasks = [
    { id: 1, title: 'Monthly security audit', dueDate: 'Tomorrow' },
    { id: 2, title: 'Review user access logs', dueDate: 'In 2 days' },
    { id: 3, title: 'Update system patches', dueDate: 'Next week' },
    { id: 4, title: 'Conduct team meeting', dueDate: 'Next Friday' },
    { id: 5, title: 'Review quarterly reports', dueDate: 'In 10 days' }
  ];

  return (
    <div className="admin-dashboard" style={{ 
      display: 'grid', 
      gridTemplateColumns: '1fr 1fr', 
      gridTemplateRows: '1fr 1fr', 
      gap: '1.5rem', 
      height: '100%', 
      maxHeight: 'calc(100vh - 110px)' 
    }}>
      {/* Top Left - System Statistics */}
      <div className="dashboard-card" style={{ 
        display: 'flex', 
        flexDirection: 'column', 
        justifyContent: 'space-between' 
      }}>
        <div>
          <div className="stats-content" style={{ 
            display: 'grid', 
            gridTemplateColumns: 'repeat(3, 1fr)', 
            gap: '1rem' 
          }}>
            <div className="stat-item">
              <span className="stat-label">Total Users</span>
              <span className="stat-value">{systemStats.totalUsers}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Active Today</span>
              <span className="stat-value">{systemStats.activeToday}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">New This Week</span>
              <span className="stat-value">{systemStats.newThisWeek}</span>
            </div>
          </div>
        </div>
      </div>

      {/* Top Right - Users List */}
      <div className="dashboard-card" style={{ 
        overflowY: 'auto', 
        maxHeight: '100%' 
      }}>
        <UsersList />
      </div>

      {/* Bottom Left - Recent Activities */}
      <div className="dashboard-card" style={{ 
        overflowY: 'auto', 
        maxHeight: '100%' 
      }}>
        <h3 style={{ marginBottom: '1rem' }}>Recent Activities</h3>
        <ul className="activity-list">
          {recentActivities.map(activity => (
            <li key={activity.id} style={{ 
              display: 'flex', 
              justifyContent: 'space-between', 
              padding: '0.6rem 0',
              borderBottom: '1px solid var(--light-gray)'
            }}>
              <span>{activity.message}</span>
              <span style={{ 
                color: '#666', 
                fontSize: '0.8rem' 
              }}>{activity.timestamp}</span>
            </li>
          ))}
        </ul>
      </div>

      {/* Bottom Right - Upcoming Tasks */}
      <div className="dashboard-card" style={{ 
        overflowY: 'auto', 
        maxHeight: '100%' 
      }}>
        <h3 style={{ marginBottom: '1rem' }}>Upcoming Tasks</h3>
        <ul className="activity-list">
          {upcomingTasks.map(task => (
            <li key={task.id} style={{ 
              display: 'flex', 
              justifyContent: 'space-between', 
              padding: '0.6rem 0',
              borderBottom: '1px solid var(--light-gray)'
            }}>
              <span>{task.title}</span>
              <span style={{ 
                color: '#666', 
                fontSize: '0.8rem' 
              }}>{task.dueDate}</span>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default AdminDashboard;
